  `send_method` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '发送方式',
  `ip` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '单独支持的ip地址',
  `create_by` int(11) NOT NULL COMMENT '创建人',
  `update_by` int(11) NULL DEFAULT NULL COMMENT '更新人',
  `create_date` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '创建时间',
  `update_date` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更新时间',
  `is_validity` int(2) NOT NULL COMMENT '有效性（1，有效；0，无效）',
  `is_delete` int(2) NOT NULL COMMENT '删除（1，有效；0，无效）',
  PRIMARY KEY (`id`) USING BTREE,
